import React from "react";
const Publicite = () => {
  return (
    <div>
      <div>
        <h2 className="page-header">Publicité list :</h2>
        <div className="row">
          <div className="col-12">
            <button className="button col-1">Add Publicité</button>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Publicite;
